from math import sqrt

import torch


def get_hadK(n, transpose=False):  # noqa: C901
    hadK, K = None, None
    if n % 172 == 0:  # llama-2-7b up
        assert is_pow2(n // 172)

        K = 172
        hadK = get_had172().T if transpose else get_had172()
    elif n % 156 == 0:  # llama-1-30b 3x hidden
        assert is_pow2(n // 156)

        K = 156
        hadK = get_had156().T if transpose else get_had156()
    elif n % 140 == 0:  # llama-1-30b intermediate
        assert is_pow2(n // 140)

        K = 140
        hadK = get_had140().T if transpose else get_had140()
    elif n % 108 == 0:  # llama-1-13b intermediate
        assert is_pow2(n // 108)

        K = 108
        hadK = get_had108().T if transpose else get_had108()
    elif n % 60 == 0:  # llama-1-13b 3x hidden
        assert is_pow2(n // 60)

        K = 60
        hadK = get_had60().T if transpose else get_had60()
    elif n % 52 == 0:  # llama-1-13b 1x hidden
        assert is_pow2(n // 52)

        K = 52
        hadK = get_had52().T if transpose else get_had52()
    elif n % 36 == 0:
        assert is_pow2(n // 36)

        K = 36
        hadK = get_had36().T if transpose else get_had36()
    elif n % 28 == 0:
        assert is_pow2(n // 28)

        K = 28
        hadK = get_had28().T if transpose else get_had28()
    elif n % 44 == 0:
        assert is_pow2(n // 44)

        K = 44
        hadK = get_had44().T if transpose else get_had44()
    elif n % 40 == 0:
        assert is_pow2(n // 40)

        K = 40
        hadK = get_had40().T if transpose else get_had40()
    elif n % 20 == 0:
        assert is_pow2(n // 20)

        K = 20
        hadK = get_had20().T if transpose else get_had20()
    elif n % 12 == 0:
        assert is_pow2(n // 12)

        K = 12
        hadK = get_had12().T if transpose else get_had12()
    else:
        assert is_pow2(n)

        K = 1

    return hadK, K


def hadamard_transform(x: torch.Tensor, K=1, hadK=None):
    # See https://github.com/amitport/hadamard-transform/tree/main hadamard_transform
    original_shape = x.shape
    assert 1 <= len(original_shape) <= 2, "input's dimension must be either 1 or 2"
    if len(original_shape) == 1:
        # add fake 1 batch dimension
        # for making the code a follow a single (batched) path
        x = x.unsqueeze(0)
    batch_dim, d = x.shape

    h = 2
    while h * K <= d:
        hf = h // 2
        x = x.view(batch_dim, d // h, h)
        half_1, half_2 = x[:, :, :hf], x[:, :, hf:]
        x = torch.cat((half_1 + half_2, half_1 - half_2), dim=-1)
        h *= 2
    if K > 1:
        x = hadK.view(1, K, K).to(x) @ x

    return (x / sqrt(d)).view(*original_shape)


def is_pow2(n):
    return (n & (n - 1) == 0) and (n > 0)


